import React, { useEffect } from 'react'
import axios from 'axios';
import { AxiosContext } from 'react-axios/lib/components/AxiosProvider';
import { getDefaultNormalizer } from '@testing-library/react';
const TodosList = ({input,todos, setTodos,editTodo ,setEditToDo,setInput}) => {

  const handleDelete = async (todo) => {
    const newTodos = todos.filter(item => item.id != todo.id)
    setTodos(newTodos)  
    await axios.delete("https://630fada536e6a2a04edfbc08.mockapi.io/todos/"+todo.id)
    }
    useEffect(() => {
      getData()  
    }, []);

    const getData =async () => {
        const allData = await axios.get("https://630fada536e6a2a04edfbc08.mockapi.io/todos/")
        console.log(allData, "data")
        setTodos(allData.data, "allData")
        
    }
    
  const handleEdit = async(todo) => 
  {
    const findTodo = todos.filter(item => item.id == todo.id);
    
    //setInput(findTodo[0].todovalue);
    console.log(findTodo,"todoslist")
  }
    
    //setEditToDo(findTodo.data)
    // await axios.put("https://630fada536e6a2a04edfbc08.mockapi.io/todos/"+todo.id,{
    //   todovalue: input
    // })
      
    
    //setEditToDo(findTodo);
  

  return (
    <div>
        {todos.map((todo) => (
            <li className='list-item' key={todo.id}>
                <input 
                  type="text" 
                  value = {todo.todovalue} 
                  className= {`list ${todo.completed} ? "completed" : "" `} 
                  onChange={(e) => e.preventDefault()} 
                />
                <div>
                
                <button className='button-edit' onClick={() => handleEdit(todo)}> Edit</button>
                <button className='button-delete' onClick={() => handleDelete(todo)}>Delete</button>
                
                </div>
            </li>
        ))}
    </div>
  );
};

export default TodosList
